ns+not+a+bad+flick.+Surely+a+film+to+recommend+for+anime+fans%2C+as+well+as+for+animation%27s+%28western+audience%29.%0D%0A%0D%0AThe+story+of+two+teenagers%2C+one+from+the+rural+Japan+mountain+region+and+the+other+one+from+Tokyo.+The+plot+revolves+around+a+comet+that+is+to+pass+by+very+close+to+the+earth.+But+before+that+event%2C+the+girl+is+bored+with+her+life%2C+so+she+dreams+of+living+in+a+big+city+and+that+too+as+a+boy.+One+day+her+wish+comes+true+when+she+wakes+up+as+she+swapped+bodies%2C+including+most+of+the+memories+with+a+boy+from+Tokyo.%0D%0A%0D%0AFor+her%2C+it+is+to+live+as+she+wanted+and+make+use+of+the+opportunity.+But+for+him%2C+it+is+like+a+curse%2C+hence+becomes+rebellious.+This+thing+keeps+happening+frequently+for+days+and+weeks.+After+some+times%2C+realising+the+phenomena+is+between+two%2C+they+make+a+deal+and+strict+order+of+Dos+and+Don%27ts+while+away.+All+this+until+the+day+of+comet+and+everything+changes+forever.+Searching+for+the+truth+and+the+result+of+it+leads+to+the+end+of+the+tale.%0D%0A%0D%0A%3E+%E2%9D%9DTreasure+the+experience.+Dreams+fade+away+after+you+wake+up.%E2%9D%9E%0D%0A%0D%0AUnlike+Miyazaki%2C+Makot+Shinkai%27s+storytelling+is+quite+for+the+matured+audience.+It+targets+adults+more+than+the+children.+Particularly+for+not+shying+away+to+include+naturally+occurring+events+in+such+situation+as+the+story+develops%2C+despite%2Feven+though+the+film+revolves+around+the+teens%2Fkids.+As+for+this+flick%2C+the+concern+is+not+big%2C+but+it+depends+on+the+nation+and+its+culture+you+belong+to.+It+is+very+much+acceptable+and+as+the+story+progress%2C+the+best+things+keep+replacing+another+till+the+finale.+So+hooked+to+it+is+assured.%0D%0A%0D%0AThe+film+length+was+good+and+so+the+pace+of+the+narration.+Well+written+screenplay%2C+which+was+based+on+the+book+of+the+same+name.+But+the+director+admits+the+inspiration+from+the+previous+flicks+with+similar+themes.+They+have+used+the+real+places+of+the+anime+version+with+fictional+names%2C+but+most+of+the+Tokyo+remains+same+and+they+all+were+awesome.%0D%0A%0D%0AIn+many+scenes%2C+the+camera+panning+was+a+treat.+Especially+the+framerate+was+high%2C+so+no+jerks%2C+hence+very+pleasurable+visual+experience.+Like+I+mentioned+earlier%2C+this+is+a+unique+film%2C+despite+not+a+original+idea.+The+film+proved+the+Japan+is+not+overshadowed+by+Hollywood%2C+particularly+after+the+decline+of+animes+in+the+recent+years.+It%27s+up+to+the+quality+of+the+product%2C+if+so%2C+then+those+glory+days+can+be+brought+back+for+animes.+Anyway%2C+now+this+film+holds+the+record+for+highest+grossed+anime.%0D%0A%0D%0AApart+from+technical+dominance%2C+the+story+is+also+enchanting.+If+you+like+romance+theme%2C+this+will+serve+you+well.+A+good+film+for+date+night.+But+usually+people+would+skip+animation+for+such+occasion+and+one+should+not+mix+up+that+with+anime.+Because+why+I+always+put+apart+the+anime+and+animation+is%2C+the+animes+are+good+at+beautiful+romance%2C+while+its+counterpart+from+the+west+focus+more+on+comedy+and+adventure.+But+the+common+thing+from+them+is+the+well+explored+fantasy+theme.%0D%0A%0D%0AUsually+the+ends+are+guessable+for+a+film+like+this+and+the+same+case+for+this+in+here.+Only+as+a+result+of+the+story%2C+you+would+know+what%27s+coming%2C+but+not+the+frame+by+frame+scenes+of+it.+Yeah%2C+I+liked+this+conclusion%2C+the+final+lines+said+might+bring+you+tears+in+your+eyes%2C+romantically%2C+if+you+are+an+emotional+person.+One+of+the+best+endings%2C+even+though+it+was+clich%C3%A9d.+And+the+credits+start+to+roll+up%2C+while+you+begin+to+recall+everything+you+just+saw+in+the+last+100+minutes.+A+must+see+film%2C+so+highly+recommended+by+my+side.+Now+I%27ve+to+wait+for+another+couple+of+years+for+such+film.%0D%0A%0D%0A_8%2F10_&content%5Bresults%5D%5B2%5D%5Bid%5D=5901278dc3a36810c600301c&content%5Bresults%5D%5B2%5D%5Burl%5D=https%3A%2F%2Fwww.themoviedb.org%2Freview%2F5901278dc3a36810c600301c&content%5Btotal_pages%5D=1&content%5Btotal_results%5D=3&statusCode=200
